// Standard Libraries
import React from 'react'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

// Pages
import HomePage from './pages/HomePage';
import ViewAllGamesPage from "./pages/ViewAllGamesPage";
import ViewAllItemsPage from "./pages/ViewAllItemsPage";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route exact path="/view_game:game" component={ViewAllGamesPage} />
        <Route exact path="/view_item:item" component={ViewAllItemsPage} />
      </Switch>
    </Router>
  );
}

export default App;
